function Home() {
  return (
    <>


      <InfoSection {...homeObjHero} />
      {/* hero image */}

      <section id='s1'>
        <InfoSection {...homeObjOfer1} />
      {/* oferta 1 prawa */}
      </section>

      <InfoSection {...homeObjOfer2} />
      {/* oferta 2 lewa */}

      <InfoSection {...homeObjOfer3} />
      {/* oferta 3 prawa */}

      <section id='s1'>
      <Pricing />
      {/* PRZYK≈ÅADOWE CENY */}
      </section>

      <section id='s1'>
      <InfoSection {...homeObj500} />
      </section>
      {/* zgarnij500 */}

      <section id='s1'>
      <InfoSection {...homeObjOmnie} />
      </section>


    </>
  );
}

export default Home;
